$(document).ready(function(){var e=$(".category_container");var t=$(".site_modify_link");t.click(function(t){t.preventDefault();var n=$(this).attr("data-target");if(n!="All"){$(e).each(function(){if($(this).attr("data-id")!=n){$(this).hide()}else{$(this).show()}})}else{$(e).each(function(){$(this).show()})}})})